import React from 'react';
import Slider from 'slider-moon';
import 'slider-moon/dist/style.css'
import {picture} from './Images/human-resource-management-removebg-preview.png'
import './I.css'
export const I = () => {

  return (
    <div className='App'>

      <Slider
        slideClass={'my-scale'}
        infinite={true}
        bullets={true}
        arrowsNav={true}
        animation={'scale'}
      >
        <div className='slider my-scale'>
          <ul className='slider-wrapper'>
            {item.map((item) => (
              <li key={item}>
                <img alt='' src={picture} />
              </li>
            ))}
          </ul>
        </div>
      </Slider>
    </div>
  )
}
